import React, { useEffect, useState } from 'react';
import "./Profile.css";

export default function Profile() {
    const [pic, setPic] = useState([])

    useEffect(() => {
        fetch("http://localhost:5000/myposts",{
            headers:{
                Authorization: "Bearer " + localStorage.getItem("jwt")
            }
        })
        .then(res=>res.json())
        .then((result)=>{
            setPic(result)
            console.log(pic)
        })
    }, [])

    return (
    <div className="profile">
        {/* Profile frame */}
        <div className="profile-frame">
            {/* profile-pic */}
            <div className="profile-pic">
                <img src="https://media.istockphoto.com/id/1226793777/photo/black-and-white-beautiful-smiling-woman-portrait-isolated-on-white-background.jpg?s=612x612&w=0&k=20&c=93Fs3jBtzZFyRBrT3_JtxGLmtBw8gLg6-7zj1Yr_MII="
                    alt="" />
            </div>
            {/* profile-data */}
            <div className="pofile-data">
                <h1>Dakshya</h1>
                <div className="profile-info" style={{ display:"flex" }}>
                    <p>40 posts</p>
                    <p>40 followers</p>
                    <p>40 following</p>
                </div>
            </div>
        </div>

    <hr style={{
        width:"90%",
        opacity:"0.8",
        margin:"auto"
    }} />

        {/* Gallery */}
        <div className="gallery">
            {pic.map((pic)=>{
                return <img src="p"></img>
            })}
        </div>
    </div>
    );
}
